# This file contains common pin mappings for the Fysetc Spider board.
# To use this config, the firmware should be compiled for the STM32F446.
# When calling "menuconfig", enable "extra low-level configuration setup"
# and select the "12MHz crystal" as clock reference
# For flashing, write the compiled klipper.bin to memory location 0x08000000

# See docs/Config_Reference.md for a description of parameters.
## Voron Design VORON2 250/300/350mm Spider TMC2209 UART config

## *** THINGS TO CHANGE/CHECK: ***
## MCU paths							[mcu] section
## Thermistor types						[extruder] and [heater_bed] sections - See 'sensor types' list at end of file
## Z Endstop Switch location			[safe_z_home] section
## Homing end position                  [gcode_macro G32] section
## Z Endstop Switch  offset for Z0		[stepper_z] section
## Probe points							[quad_gantry_level] section
## Min & Max gantry corner postions		[quad_gantry_level] section
## PID tune								[extruder] and [heater_bed] sections
## Fine tune E steps					[extruder] section
[include mainsail.cfg]
[include fluidd.cfg]
[include H36.cfg]
#[include stealthburner_led_effects_barf.cfg]
[include stealthburner_led_effects_3_leds.cfg]
[include macros.cfg]
[include heat-soak-timer.cfg]
[include KAMP_Settings.cfg]
[include OrbiterSensor.cfg]

[printer]
kinematics: corexy
max_velocity: 600  
max_accel: 5800			        #Max 4000
max_z_velocity: 15			#Max 15 for 12V TMC Drivers, can increase for 24V
max_z_accel: 350
square_corner_velocity: 5.0

## Below is the config for SB CAN TH, copy from sb_can_th.cfg
## https://github.com/FYSETC/FYSETC_SB_CAN_TOOLHEAD/blob/main/sb_can_th.cfg
[idle_timeout]
timeout:43200
#####################################################################
#       Cartographer
#####################################################################

#    Number of passes to make during mesh scan.
#####################################################################
#       Probe
#####################################################################
#[probe]
##      Inductive Probe - If you use this section , please comment the [bltouch] section
##      This probe is not used for Z height, only Quad Gantry Leveling
##      In Z+ position
##      If your probe is NO instead of NC, add change pin to ^sb_can_th:PB6
#pin: SB2040:gpio22 # In IN.0 position
#x_offset: 0
#y_offset: 0 #25.0
#z_offset: 0
#speed: 10.0
#samples: 3
#samples_result: median
#sample_retract_dist: 3.0
#samples_tolerance: 0.01  #0.006
#samples_tolerance_retries: 3


[extruder]
#control = pid
#pid_kp = 26.213
#pid_ki = 1.304
#pid_kd = 131.721
##   TAP

#####################################################################
#       Bltouch
#####################################################################

#[bltouch]
##      Bltouch - If you use this section , please comment the [probe] section
##      More infomation at : https://www.klipper3d.org/BLTouch.html
##      This bltouch is not used for Z height, only Quad Gantry Leveling
##      In IO.1 position
#sensor_pin: sb_can_th:PB11 
##      In IO.2 Position
#control_pin: sb_can_th:PB7
#x_offset: 0
#y_offset: 25.0
#z_offset: 0
#speed: 10.0
#samples: 3
#samples_result: median
#sample_retract_dist: 3.0
#samples_tolerance: 0.006
#samples_tolerance_retries: 3

[mcu]
##  You need to select 'Communication interface' to USB in 'make menuconfig'
##  when you compile Klipper for Spider
##	Obtain definition by "ls -l /dev/serial/by-id/" then unplug to verify
##--------------------------------------------------------------------
#serial: /dev/serial/by-id/usb-Klipper_stm32f446xx_230032000851363131363530-if00

##	If you want to use the Raspberry uart0 to communicate with Spider, 
##  you need to select 'Communication interface' to 'Serial (on USART1 PA10/PA9)' 
##  in 'make menuconfig' when you compile klipper and set the serial as below
##--------------------------------------------------------------------
#serial: /dev/ttyAMA0
## Uncomment below if you're using the Raspberry uart0 to communicate with Spider
#restart_method: command

##--------------------------------------------------------------------
## If you want to use Spider as USB to CAN bridge,you need to select 
## 'Communication interface' to 'USB to CAN bus bridge (USB on PA11/PA12)' 
##  in 'make menuconfig' when you compile klipper and follow the instruction on
## klipper docs to set the canbus id : http://www.klipper3d.org/CANBUS.html?h=can
##--------------------------------------------------------------------
canbus_uuid=9396cfa87cb2


[mcu cartographer]
canbus_uuid: 23af92abe2f3
#serial: /dev/serial/by-id/usb-cartographer_cartographer_
#    adjust to suit your scanner, if using usb change to serial

[cartographer]
mcu: cartographer            
#   Offsets are measured from the centre of your coil, to the tip of your nozzle 
#   on a level axis. It is vital that this is accurate. 
x_offset: 0                          
#    adjust for your cartographers offset from nozzle to middle of coil
y_offset: 21.65                         
#    adjust for your cartographers offset from nozzle to middle of coil
#   Backlash compensation distance for removing Z backlash before measuring
#   the sensor response.
verbose: yes

[bed_mesh]
zero_reference_position: 175, 175    
#    set this to the middle of your bed
speed: 300
#    movement speed of toolhead during bed mesh
horizontal_move_z: 3
#    height of scanner during bed mesh scan
mesh_min: 30, 30
#    start point of bed mesh [X, Y]
mesh_max: 320, 320
#    end point of bed mesh [X, Y]
probe_count: 80, 80
adaptive_margin: 10
mesh_pps: 0,0

[axis_twist_compensation]
calibrate_start_x=30
calibrate_end_x=230
calibrate_start_y=30
calibrate_end_y=298.35
#####################################################################
#      X/Y Stepper Settings
#####################################################################

[stepper_x]
##	Connected to X-MOT (B Motor)
step_pin: PE11
dir_pin: PE10
enable_pin: !PE9
rotation_distance: 40
microsteps: 16
full_steps_per_rotation:200  #set to 400 for 0.9 degree stepper
endstop_pin: H36_combo: PA10 #^PB14
position_min: 0

##--------------------------------------------------------------------

##	Uncomment below for 250mm build
#position_endstop: 250
#position_max: 250

##	Uncomment for 300mm build
#position_endstop: 300
#position_max: 300

##	Uncomment for 350mm build
position_endstop: 350
position_max: 350

##--------------------------------------------------------------------
homing_speed: 60   #Max 100
homing_retract_dist: 5
homing_positive_dir: true

##	Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_x]
uart_pin: PE7
interpolate: True
run_current: 1.0
hold_current: 0.67
sense_resistor: 0.110
diag_pin: ^PB14
#full_steps_per_rotation: 200
#stealthchop_threshold: 0

[stepper_y]
##	Connected to Y-MOT (A Motor)
step_pin: PD8
dir_pin: PB12
enable_pin: !PD9
microsteps: 16  #set to 400 for 0.9 degree stepper
endstop_pin: ^PB13
position_min: 0
rotation_distance: 40

##--------------------------------------------------------------------

##	Uncomment for 250mm build
#position_endstop: 250
#position_max: 250

##	Uncomment for 300mm build
#position_endstop: 305
#position_max: 305

##	Uncomment for 350mm build
position_endstop: 350
position_max: 359

##--------------------------------------------------------------------
homing_speed: 60  #Max 100
homing_retract_dist: 5
homing_positive_dir: true

##	Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_y]
uart_pin: PE15
interpolate: True
run_current: 1.0
hold_current: 0.7
sense_resistor: 0.110
#stealthchop_threshold: 0
diag_pin: ^mcu:PB13



#stealthchop_threshold: 0

#####################################################################
#   Z Stepper Settings
#####################################################################

## In Z-MOT Position
## Z0 Stepper - Front Left
[stepper_z]
step_pin: PD14
dir_pin: PD13
enable_pin: !PD15
rotation_distance: 40
gear_ratio: 80:16
microsteps: 16
##  In Z- Position
endstop_pin: probe:z_virtual_endstop #^PA0
##  Z-position of nozzle (in mm) to z-endstop trigger point relative to print surface (Z0)
##  (+) value = endstop above Z0, (-) value = endstop below
##	Increasing position_endstop brings nozzle closer to the bed
##  After you run Z_ENDSTOP_CALIBRATE, position_endstop will be stored at the very end of your config
#position_endstop: 0.0
##--------------------------------------------------------------------

##	Uncomment below for 250mm build
#position_max: 240

##	Uncomment below for 300mm build
#position_max: 290

##	Uncomment below for 350mm build
position_max: 350

##--------------------------------------------------------------------
position_min: -15
homing_speed: 8
second_homing_speed: 3
homing_retract_dist: 0

##	Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_z]
uart_pin: PD10
uart_address: 0
interpolate: true
run_current: 0.8
hold_current: 0.8
sense_resistor: 0.110
#stealthchop_threshold: 0


##	In E1-MOT Position
##	Z1 Stepper - Rear Left
[stepper_z1]
step_pin: PE6
dir_pin: !PC13
enable_pin: !PE5
rotation_distance: 40
gear_ratio: 80:16
microsteps: 16

##	Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_z1]
uart_pin: PC14
interpolate: true
run_current: 0.8
hold_current: 0.8
sense_resistor: 0.110

##	In E2-MOT Position
##	Z2 Stepper - Rear Right
[stepper_z2]
step_pin: PE2
dir_pin: PE4
enable_pin: !PE3
rotation_distance: 40
gear_ratio: 80:16
microsteps: 16

##	Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_z2]
uart_pin: PC15
interpolate: true
run_current: 0.8
hold_current: 0.8
sense_resistor: 0.110

##	In E3-MOT Position
##	Z3 Stepper - Front Right
[stepper_z3]
step_pin: PD12
dir_pin: !PC4
enable_pin: !PE8
rotation_distance: 40
gear_ratio: 80:16
microsteps: 16

[tmc2209 stepper_z3]
uart_pin: PA15
interpolate: true
run_current: 0.8
hold_current: 0.8
sense_resistor: 0.110

#####################################################################
#   Bed Heater
#####################################################################
[heater_bed]
##	SSR Pin - In BED OUT position
heater_pin: PB4
sensor_type: NTC 100K MGB18-104F39050L32
#sensor_pin: PC3 # Spider 1.x
sensor_pin: PC0 # Spider 2.x
##	Adjust Max Power so your heater doesn't warp your bed
max_power: 0.75
min_temp: 0
max_temp: 120
#control: pid
#pid_kp: 58.437
#pid_ki: 2.347
#pid_kd: 363.769
#####################################################################
#	Fan Control
#####################################################################

[heater_fan controller_fan]
##	Controller fan - FAN2 Connector
pin: PB7
kick_start_time: 0.5
heater: heater_bed
heater_temp: 45.0
fan_speed: 0.5

#[heater_fan stepper_fan]
##	Controller fan - FAN2 Connector
#pin: PB2
#kick_start_time: 0.5
#heater: heater_bed
#heater_temp: 45.0
#fan_speed: 1

[heater_fan stepstick]
pin: PB2
kick_start_time: 0.5
heater: heater_bed
heater_temp: 45.0
fan_speed: 0.2

[output_pin pi_cooling_boot_pin]
pin: PA13
value: 1
shutdown_value: 1  # Keeps the pin ON even if Klipper reaches an error state


[output_pin nevermore]
pin: PC8
value: 0
shutdown_value: 0

#[neopixel Chamber]
#pin: PD3
#chain_count: 100
#color_order: GRB

#[virtual_leds nozzle_leds]
#leds: neopixel:A4T_leds (2-3)

#[heater_fan exhaust_fan]
##  Exhaust fan - In E2 OUT Positon
#pin: PB3
#max_power: 1.0
#shutdown_speed: 0.0
#kick_start_time: 5.0
#heater: heater_bed
#heater_temp: 60
#fan_speed: 1.0

#####################################################################
#	LED Control
#####################################################################

#[output_pin caselight ]
##  Chamber Lighting - In 5V-RGB Position
#pin: PD3
#pwm: true
#shutdown_value: 0
#value:100
#cycle_time: 0.01

#####################################################################
#	Homing and Gantry Adjustment Routines
#####################################################################

[idle_timeout]
timeout: 24600
   
[quad_gantry_level]
##	Use QUAD_GANTRY_LEVEL to level a gantry.
##	Min & Max gantry corners - measure from nozzle at MIN (0,0) and 
##	MAX (250, 250), (300,300), or (350,350) depending on your printer size
##	to respective belt positions

#--------------------------------------------------------------------
##	Gantry Corners for 250mm Build
##	Uncomment for 250mm build
#gantry_corners:
#	-60,-10
#	310, 320
##	Probe points
#points:
#	50,25
#	50,175
#	200,175
#	200,25
	
##	Gantry Corners for 300mm Build
##	Uncomment for 300mm build
#gantry_corners:
#	-60,-10
#	360,370
##	Probe points
#points:
#	25,25
#	25,225
#	275,225
#	275,25

###	Gantry Corners for 350mm Build
###	Uncomment for 350mm build
gantry_corners:
	-60,-10
	410,420
###	Probe points
points:
	50,25
	50,275
	300,275
	300,25

##	Gantry Corners for TAP 350mm Build
##	Uncomment for TAP 350mm build
#gantry_corners:
	#-60,-10
	#410,420
##	Probe points
#points:
	#50,50
	#50,300
	#300,300
	#300,50

#--------------------------------------------------------------------
speed: 100
horizontal_move_z: 10
retries: 5
retry_tolerance: 0.01   #0.0075
max_adjust: 10

#####################################################################
#	Mcu and Host Temperature
#####################################################################

[temperature_sensor main_mcu_temp]
sensor_type: temperature_mcu
min_temp: 0
max_temp: 150


[temperature_sensor host]
sensor_type: temperature_host
min_temp: 0
max_temp: 150

[temperature_sensor cartographer]
sensor_type: temperature_mcu
sensor_mcu: cartographer
min_temp: 5
max_temp: 105

[safe_z_home]
home_xy_position: 175,175
z_hop: 10

[adxl345]
cs_pin: cartographer:PA0
spi_bus: spi1

[resonance_tester]
accel_chip: adxl345
probe_points:
    175, 175, 20

[force_move]
enable_force_move: true

[skew_correction]
[gcode_arcs]

[autotune_tmc extruder]
motor: fysetc-g36hsy4405-6d-30
[autotune_tmc stepper_x]
motor: fysetc-17HS19-2004S-AB
[autotune_tmc stepper_y]
motor: fysetc-17HS19-2004S-AB
[autotune_tmc stepper_z]
motor: fysetc-17HS19-2004S-C
tuning_goal: performance
[autotune_tmc stepper_z1]
motor: fysetc-17HS19-2004S-C
tuning_goal: performance
[autotune_tmc stepper_z2]
motor: fysetc-17HS19-2004S-C
tuning_goal: performance
[autotune_tmc stepper_z3]
motor: fysetc-17HS19-2004S-C
tuning_goal: performance





